import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Line } from 'react-chartjs-2';


ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);


const Data = {
    labels: ["Nov", "Dec", "Jan", "Feb", "March", "April"],
    datasets: [
        {
            label: "% Lifts Open",
            data: [33, 40, 80, 90, 100, 60],
            borderColor: "rgba(19, 49, 92, 1)",
            backgroundColor: "rgba(19, 49, 92,0.2)",
        },
        {
            label: "% Trails Open",
            data: [15, 30, 60, 95, 95, 45],
            borderColor: "rgba(141, 169, 196, 1)",
            backgroundColor: "rgba(141, 169, 196,0.2)",
        },
        {
            label: "% Terrain Open",
            data: [9, 23, 65, 83, 90, 34],
            borderColor: "rgba(19, 64, 116, 1)",
            backgroundColor: "rgba(19, 64, 116,0.2)",
        }
    ]
};

export function Graph() {
    return <Line data={data} />;
}
